import logo from './logo.svg';
import './App.css';
import Homepage from "./Components/Homepage";

function App() {
  return (
    <div className="Homepage">
      <header className="Homepage-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>

      <Homepage />
    </div>
  );
}

export default App;
